// src/components/SignUpPage.js
import React from 'react';
import { Link, useNavigate } from 'react-router-dom'; // Make sure Link is imported
import './SignUpPage.css'; // Import the CSS file for styling

const SignUpPage = () => {
  const navigate = useNavigate();

  const handleSignUp = (e) => {
    e.preventDefault();
    // Add your sign-up logic here (mocked for now)
    navigate('/login'); // Redirect to Login page after signing up
  };

  return (
    <div className="container">
      <div className="row m-5 no-gutters shadow-lg">
        <div className="col-md-6 bg-white p-5">
          <h2>Sign Up</h2>
          <form onSubmit={handleSignUp}>
            <div className="form-group pb-3">
              <label htmlFor="username">Username</label>
              <input type="text" id="username" className="form-control" required />
            </div>
            <div className="form-group pb-3">
              <label htmlFor="password">Password</label>
              <input type="password" id="password" className="form-control" required />
            </div>
            <button type="submit" className="btn btn-primary w-100 font-weight-bold mt-2">
              Sign Up
            </button>
          </form>
          <div className="pt-4 text-center">
            Already have an account? <Link to="/login" className="btn btn-link">Login</Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SignUpPage;
